import { Rating } from 'react-simple-star-rating'

export default function Stars({ 
  popularityScore = 0, 
  count = 5, 
  color = '#FACC6B', 
  iconSize = 20 
}) {
  return (
    <div style={styles.container}>
      <Rating
        initialValue={popularityScore}
        readonly
        allowFraction
        size={iconSize}
        fillColor={color}
        emptyColor="gray"
        SVGstyle={{ display: 'inline-block' }}
      />
      <p style={styles.text}>{popularityScore.toFixed(1)} / {count}</p>
    </div>
  )
}

const styles = {
  container: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  text: {
    marginLeft: '8px',
    fontFamily: 'Avenir Book',
    fontSize: '14px',
  },
}
